import React from 'react'

const Header = () => {
  return (
    <div className="header">
      <div className="headerList">
        <div className="headerListItem">
        <FontAwesomeIcon icon="fa-regular fa-bed" />
        </div>
      </div>
    </div>
  )
}

export default Header
